     &      (SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(Gen3)

#ifdef DETAILED_DEBUG
	DCOUP "huuSM-RenConst: dZfR1(3,gno1,gno2) =", dZfR1(3,gno1,gno2) ENDL
#endif

	endif

	if( gno2.eq.gno1 ) then

	dup5 = MW2*(48 - 64*SW2)*SW2 - 9*CW2*Mf2(tH,gno2)

	dup6 = MW2*(9 - (24 - 32*SW2)*SW2) + 9*CW2*Mf2(tH,gno2)

        dup7 = -(1/144.D0*
     &       (dup5*Re(DB0(Mf2(tH,gno2),MZ2,Mf2(tH,gno2))))/CW2) - 
     &    1/16.D0*(Mf2(tH,gno2)*
     &       Re(DB0(Mf2(tH,gno2),Mf2(tH,gno2),MHiggs2(hno))))

        dZfL1(3,gno2,gno1) = 
     &   1/Pi*(AlfaMZ*(1/144.D0*(3 - 4*SW2)**2/CW2 + 
     &         (1/144.D0*((2*MW2*(3 - 4*SW2)**2 + 
     &                  9*CW2*Mf2(tH,gno2))*
     &                Re(B1(Mf2(tH,gno2),Mf2(tH,gno2),MZ2)))/CW2 + 
     &            1/8.D0*(Mf2(tH,gno2)**2*
     &               Re(DB1(Mf2(tH,gno2),Mf2(tH,gno2),
     &                 MHiggs2(hno)))) + 
     &            (2*dup7 + 
     &               1/16.D0*
     &                Re(B1(Mf2(tH,gno2),Mf2(tH,gno2),
     &                  MHiggs2(hno))) + 
     &               1/72.D0*
     &                (dup6*
     &                   Re(DB1(Mf2(tH,gno2),Mf2(tH,gno2),MZ2)))/
     &                 CW2)*Mf2(tH,gno2))/MW2))/SW2

	LOOP(Gen3, 1,3,1)

        dZfL1(3,gno2,gno1) = 
     &   dZfL1(3,gno2,gno1) + 
     &    1/Pi*(AlfaMZ*CKM(gno2,Gen3)*CKMC(gno2,Gen3)*
     &        (1/8.D0*(1 + ((2*MW2 + Mf2(bH,Gen3))*
     &                Re(B1(Mf2(tH,gno2),Mf2(bH,Gen3),MW2)))/MW2)+
     &            ((1/4.D0*(Mf2(bH,Gen3)*
     &                  Re(DB0(Mf2(tH,gno2),MW2,Mf2(bH,Gen3)))) + 
     &               1/8.D0*((2*MW2 + Mf2(bH,Gen3) + Mf2(tH,gno2))*
     &                  Re(DB1(Mf2(tH,gno2),Mf2(bH,Gen3),MW2))))*
     &             Mf2(tH,gno2))/MW2))/SW2

	ENDLOOP(Gen3)

#ifdef DETAILED_DEBUG
	DCOUP "huuSM-RenConst: dZfL1(3,gno2,gno1) =", dZfL1(3,gno2,gno1) ENDL
#endif

        dZfR1(3,gno2,gno1) = 
     &   1/Pi*(AlfaMZ*(1/9.D0*SW2/CW2 + 
     &        (1/144.D0*((32*MW2*SW2**2 + 9*CW2*Mf2(tH,gno2))*
     &               Re(B1(Mf2(tH,gno2),Mf2(tH,gno2),MZ2)))/CW2 + 
     &           1/8.D0*(Mf2(tH,gno2)**2*
     &              Re(DB1(Mf2(tH,gno2),Mf2(tH,gno2),MHiggs2(hno)))
     &              ) + (2*dup7 + 
     &              1/16.D0*Re(B1(Mf2(tH,gno2),Mf2(tH,gno2),
     &                 MHiggs2(hno))) + 
     &              1/72.D0*(dup6*
     &                  Re(DB1(Mf2(tH,gno2),Mf2(tH,gno2),MZ2)))/CW2
     &              )*Mf2(tH,gno2))/(MW2*SW2)))

	LOOP(Gen3, 1,3,1)

        dZfR1(3,gno2,gno1) = 
     &   dZfR1(3,gno2,gno1) + 
     &    1/Pi*(AlfaMZ*CKM(gno2,Gen3)*CKMC(gno2,Gen3)*
     &        (1/4.D0*(Mf2(bH,Gen3)*
     &             Re(DB0(Mf2(tH,gno2),MW2,Mf2(bH,Gen3)))) + 
     &          1/8.D0*(Re(B1(Mf2(tH,gno2),Mf2(bH,Gen3),MW2)) + 
     &             (2*MW2 + Mf2(bH,Gen3) + Mf2(tH,gno2))*
     &              Re(DB1(Mf2(tH,gno2),Mf2(bH,Gen3),MW2))))*
     &        Mf2(tH,gno2))/(MW2*SW2)

	ENDLOOP(Gen3)

#ifdef DETAILED_DEBUG
	DCOUP "huuSM-RenConst: dZfR1(3,gno2,gno1) =", dZfR1(3,gno2,gno1) ENDL
#endif

	else

	dZfL1(3,gno2,gno1) = 0

	LOOP(Gen3, 1,3,1)

        dZfL1(3,gno2,gno1) = 
     &   dZfL1(3,gno2,gno1) + 
     &    1/(4.D0*Pi)*(AlfaMZ*CKM(gno2,Gen3)*CKMC(gno1,Gen3)*
     &        (Mf2(tH,gno1) + 
     &          (Mf2(bH,Gen3)*(Mf2(tH,gno1) + Mf2(tH,gno2))*
     &              Re(B0(Mf2(tH,gno1),MW2,Mf2(bH,Gen3))) + 
     &             Mf2(tH,gno1)*
     &              (2*MW2 + Mf2(bH,Gen3) + Mf2(tH,gno2))*
     &              Re(B1(Mf2(tH,gno1),Mf2(bH,Gen3),MW2)))/MW2))/
     &      (SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(Gen3)

#ifdef DETAILED_DEBUG
	DCOUP "huuSM-RenConst: dZfL1(3,gno2,gno1) =", dZfL1(3,gno2,gno1) ENDL
#endif

	dZfR1(3,gno2,gno1) = 0

	LOOP(Gen3, 1,3,1)

        dZfR1(3,gno2,gno1) = 
     &   dZfR1(3,gno2,gno1) + 
     &    1/Pi*(AlfaMZ*CKM(gno2,Gen3)*CKMC(gno1,Gen3)*
     &        (1/4.D0 + (1/2.D0*
     &              (Mf2(bH,Gen3)*
     &                Re(B0(Mf2(tH,gno1),MW2,Mf2(bH,Gen3)))) + 
     &             1/4.D0*((2*MW2 + Mf2(bH,Gen3) + Mf2(tH,gno1))*
     &                Re(B1(Mf2(tH,gno1),Mf2(bH,Gen3),MW2))))/MW2)*
     &        Mf(tH,gno1)*Mf(tH,gno2))/
     &      (SW2*(Mf2(tH,gno1) - Mf2(tH,gno2)))

	ENDLOOP(Gen3)

#ifdef DETAILED_DEBUG
	DCOUP "huuSM-RenConst: dZfR1(3,gno2,gno1) =", dZfR1(3,gno2,gno1) ENDL
#endif

	endif

	ENDLOOP(gno2)

	ENDLOOP(gno1)

	end

